import { Alert } from '@mui/material';
import React, { useEffect, useState } from 'react'
import api from '../../api';
import AddVehicle from '../../components/addVehicle'
import Navbar from '../../components/navbar'
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

export default function DriverHome() {


  const [vehicles, setVehicles] = useState(null);
  const [alert, setAlert] = useState(0);

  const messages = {
    500: ['error', 'Server side error'],
  }


  function onLoad(){
    api.get('/getVehicles', {withCredentials: true})
    .then(data=>{
      console.log(data.data[0].vnumber);
      setVehicles(data.data);
    })
    .catch(err=>{
      setAlert(err.response.status);
    })
  }

  useEffect(() => {
    onLoad();
  }, []);
  

  return (
    <>
    <Navbar isLoggedIn={true}></Navbar>
    {
      (alert)?
      <><Alert severity={messages[alert][0]} variant='filled'>{messages[alert][1]}</Alert></>:
      <></>
    }
    <AddVehicle />
      {
        (vehicles)
        ?
        vehicles.forEach((vehicle)=>{
          <>
            <h1>{vehicle.vnumber}</h1>
            <h1>{vehicle.vtype}</h1>
            <h1>{vehicle.vname}</h1>
            {/* <Card sx={{ minWidth: 275 }}>
            <CardContent>
              <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
                Vehicle Details
              </Typography>
              <Typography variant="h5" component="div">
                {vehicle.vname}
              </Typography>
              <Typography sx={{ mb: 1.5 }} color="text.secondary">
                {vehicle.vtype}
              </Typography>
              <Typography variant="body2">
                {vehicle.vnumber}
              </Typography>
            </CardContent>
            <CardActions>
              <Button size="small">Edit Details</Button>
            </CardActions>
            </Card> */}
          </>
        })
        :<></>
      }
    </>
  )
}
